// Step 1: Login first
_loginPage.default.visit();
_loginPage.default.enterEmail(this.data.validUser.email);
_loginPage.default.enterPassword(this.data.validUser.password);
_loginPage.default.clickSignIn();
cy.contains('Order History', {
  timeout: 20000
}).should('be.visible');
// Step 2: Go to Order Sims page
_orderSimsPage.default.visit();
cy.url().should('include', '/order-sims');
// Step 3: Fill in order details
_orderSimsPage.default.enterRetailStoreName(this.data.orderSims.storeName);
_orderSimsPage.default.enterDeliveryAddress(this.data.orderSims.deliveryAddress);
_orderSimsPage.default.enterNumberOfSims(this.data.orderSims.sims);
//OrderSimsPage.selectShippingType(this.data.orderSims.shippingType);
_orderSimsPage.default.enterMessage(this.data.orderSims.message);
// Step 4: Submit the order
_orderSimsPage.default.clickOrderSims();
// Step 5: Verify success message
_orderSimsPage.default.verifyOrderSuccess();
// Step 6: Verify order appears in Order History
_orderSimsPage.default.verifyOrderInHistory(this.data.orderSims.storeName, this.data.orderSims.sims, this.data.orderSims.status);
